INSERT INTO `conversation_messages` VALUES (236,55,'generic',127,229,'Heyy Joris! Denk ik? Boxtel is wel redelijk in de buurt. Zou ik ook mogen weten hoe je eruit ziet? x Sanne',0,NULL,'2020-02-08 15:15:47','2020-02-08 15:15:47',NULL),(237,55,'generic',127,229,'Holy.. Heb je echt zo\'n grote?',0,NULL,'2020-02-08 15:45:28','2020-02-08 15:45:28',NULL),(238,56,'generic',225,231,'Hey Rhonda, dat ziet er lekker uit! Hoe ziet het er van onderen uit? x Ilias',0,NULL,'2020-02-08 16:16:08','2020-02-08 16:16:08',NULL),(239,55,'generic',229,127,'Hi Sanne, ja ik heb echt zo\'n grote. Geen trucs gebruikt of iets in m\'n boxershort gestopt',0,NULL,'2020-02-08 16:16:50','2020-02-08 16:16:50',NULL),(240,56,'generic',231,225,'hi, thanks',1,NULL,'2020-02-08 16:16:56','2020-02-08 16:16:56',NULL),(241,56,'generic',225,231,'Je hebt ook wel echt het mooiste van beide kanten mmm. Waar geniet jij het meeste van?',0,NULL,'2020-02-08 16:20:00','2020-02-08 16:20:00',NULL),(242,55,'generic',127,229,'Ik was al bang dat er iets in je broekje verstopt zat, een bus Pringles of een flinke courgette ofzo. Des te heerlijker dat het echt is! Zou \'ie helemaal passen denk je? En om even interesse te tonen, wat doe je verder in het dagelijks leven? ',0,NULL,'2020-02-08 16:23:39','2020-02-08 16:23:39',NULL),(243,57,'generic',49,230,'Hallo Rinus. Mag ik jou een keer verwennen met mijn volle lippen? Ben dan wel heel benieuwd naar hoe je eruit ziet natuurlijk. x Charis',0,NULL,'2020-02-08 16:35:19','2020-02-08 16:35:19',NULL),(244,55,'generic',229,127,'Er zit wel wat verstopt achter m\'n boxershort maar geen courgette haha. Ik weet niet of ie helemaal gaat passen.. Maar 1 manier om daar achter te komen hé? ;)',0,NULL,'2020-02-08 16:50:18','2020-02-08 16:50:18',NULL),(245,58,'generic',165,230,'Leuk om je hier te zien Rinus, ik snap wel dat je na 4 jaar weer eens op zoek bent naar een heerlijk avontuur. Misschien wel met mij? Wie weet! Ik ben geregeld in de buurt van Leiden en zie de bordjes Sassenheim dus ge