INSERT INTO `faqs` VALUES (1,'Algemeen','Hoe werkt Altijdsex.nl?','Altijdsex.nl is een zeer eenvoudige datingsite waar je makkelijk andere mensen leert kennen voor een seksafspraakje. Het maakt niet uit of je op zoek bent naar een eenmalige date, casual sexdating of een (casual) relatie. Nadat je je gratis hebt aangemeld, kun je direct je profiel aanvullen en chatten met leuke personen. Uiteraard alleen als ze aan jouw wensen/eisen voldoen.',1,'2019-07-14 18:30:56','2019-10-11 11:53:54',0),(2,'Veiligheid','Is chatten op Altijdsex.nl veilig?','Chatten via Altijdsex.nl verloopt via een beveiligde (SSL) verbinding. Hierdoor ben je er zeker van dat niemand jouw gegevens kan inzien, laat staan stelen. Het is natuurlijk wel aan te raden om voorzichtig te zijn met het uitwisselen van persoonlijke gegevens.',1,'2019-10-11 12:01:01','2020-02-06 10:19:11',7),(3,'Credits','Wat zijn credits?','Credits gebruik je om berichten te versturen. Elk berichtje dat je stuurt kost één credit.',1,'2019-10-11 12:06:19','2019-10-11 12:06:19',0),(4,'Credits','Waarom moet ik betalen voor credits?','Door credits te gebruiken voor het versturen van berichten, zit je niet aan een abonnement of duur lidmaatschap vast. Je hebt geheel zelf in de hand hoeveel je uitgeeft. Bovendien stelt het ons in staat om de website te allen tijde te blijven verbeteren en bijvoorbeeld profielen en/of gerapporteerde profielteksten/foto\'s snel en adequaat te kunnen controleren.',1,'2019-10-11 12:11:08','2019-10-11 12:11:08',0),(5,'Veiligheid','Wat is een goed wachtwoord?','Een goed wachtwoord is een veilig wachtwoord. Kies geen eenvoudige combinaties, maar eerder voor een unieke, niet eerder gebruikte combinatie. Zo voorkom je dat iemand je wachtwoord kan raden.',1,'2019-10-11 12:12:41','2019-10-11 12:12:41',0),(6,'Credits','Hoe koop ik credits?','Door op \"Koop Credits\" te klikken kun je snel en eenvoudig credits aanschaffen. Let op: hoe groter de bundel, des te goedkoper de credits!',1,'2019-10-11 16:54:04','2019-10-11 16:54:04',0),(8,'Profiel','Hoe kan ik mijn persoonlijke profiel aanpassen?','Wanneer je rechts bovenin op \"Bewerk profiel\" klikt, kun je je profielgegevens wijzigen. Mocht je er zelf niet uitkomen, stuur dan even een mail naar info@altijdsex.nl.',1,'2019-11-14 13:08:25','2020-02-14 23:06:20',2),(9,'Algemeen','Wat is er speciaal aan Altijdsex.nl?','Je maakt op Altijdsex.nl gebruik van een live chat, waardoor je direct meerdere gesprekken in de gaten kunt houden. Bovendien kan niet iedereen zomaar jouw profiel bekijken, enkel leden kunnen elkaars profiel bekijken.',1,'2020-02-06 10:18:42','2020-02-06 10:18:42',2);
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
UNLOCK TABLES;

