INSERT INTO `tacs` VALUES (1,'Deze Algemene Voorwaarden zijn van kracht met ingang van 1 januari 2020.\r\n\r\n### Artikel 1: Definities\r\n\r\n**Altijdsex.nl**: de Vennootschap Onder Firma met beperkte aansprakelijkheid Devely V.O.F. (KvK-nummer: 77128036) handelend onder de naam Altijdsex.nl;  \r\n**Gebruiker**: de persoon die gebruik maakt van Altijdsex.nl bij deze overeenkomst;  \r\n**Website**: Altijdsex.nl  \r\n**Materiaal**: door de Gebruiker aangeleverd materiaal voor plaatsing op de Website, zoals profielnamen, teksten, foto\'s en (chat)berichten;  \r\n**Misbruik**: het plaatsen van materiaal op de Website of het versturen van berichten via de Website waarmee de rechten of privacy van anderen worden geschonden, het versturen van ongevraagde commerciële informatie en spam, het versturen van commerciële SMS-nummers, het aanbieden van financiële diensten, het doen van grievende of beledigende uitlatingen, het zich voordoen als iemand anders, het gebruiken van andermans rekeninggegevens, inbreuk maken op intellectuele eigendomsrechten of het openbaar maken of verveelvoudigen van materiaal zonder toestemming;  \r\nStandaard toegang: het gebruik van Website waarbij de Gebruiker toegang tot de Website krijgt en beperkt van de op de Website aangeboden diensten gebruik kan maken;  \r\n**VIP-toegang**: het gebruik van Website waarbij de Gebruiker toegang tot de Website krijgt en van de op de Website aangeboden diensten die onder VIP-toegang vallen gebruik kan maken;  \r\n**Toegangsvorm**: geeft aan van welke aangeboden diensten de Gebruiker gebruik kan maken op de Website. Dit is bijvoorbeeld Standaard toegang of VIP-toegang;  \r\n**Credits**: waarmee Gebruiker berichten kan versturen en kan communiceren met andere leden op de website. Wanneer de credits op zijn dienen deze te worden aangevuld om weer berichten te kunnen versturen;  \r\n**Inloggegevens**: de door Gebruiker ingevoerde gegevens waarmee de Gebruiker toegang krijgt tot de Website.  \r\n\r\n### Artikel 2: Overeenkomst\r\n\r\nDeze algemene voorwaarden maken integraal onderdeel uit van iedere tussen Website en de Gebruiker gesloten overeenkomst en zijn van toepassing op iedere overeenkomst.\r\nVan deze algemene voorwaarden afwijkende bedingen zijn slechts rechtsgeldig voor zover zij door Website schriftelijk zijn aanvaard.\r\nDe overeenkomst komt tot stand doordat de Gebruiker het op de Website vermelde inschrijfformulier via de Website aan Website toezendt en dit formulier door Website is ontvangen.\r\nDe overeenkomst is persoonlijk en niet overdraagbaar.\r\nDeelname is alleen mogelijk voor personen van 18 jaar en ouder.\r\n\r\n### Artikel 3: Prijs en betaling\r\n\r\nDe op de Website vermelde bedragen zijn inclusief 21% omzetbelasting (BTW).\r\nDe overeenkomst terzake Standaard toegang eindigt met onmiddellijke ingang door opzegging door Website of de Gebruiker.\r\nDe overeenkomst terzake Credits wordt aangegaan voor onbepaalde duur. \r\nDeze overeenkomst komt tot stand na ontvangst van de betaling van Gebruiker door Website.\r\nAan deze overeenkomst zijn voor Gebruiker geen verplichtingen gebonden. Wanneer de Credits op zijn, heeft Gebruiker geen enkele verplichting ten opzichte van de website om Credits weer aan te vullen. \r\nDe betaalwijze is afhankelijk van de gekozen betaalmethode en is naar keuze van Gebruiker. In alle gevallen betreft het een éénmalige betaling, welke discreet wordt weergegeven op bankafschrift van Gebruiker. \r\nWebsite kan de tarieven van Credits of het aan het Toegangsvorm verbonden recht van toegang tot de Website eenzijdig aanpassen, uitbreiden of intrekken.\r\n\r\n### Artikel 4: Herroepingsrecht\r\n\r\nDe Gebruiker heeft de mogelijkheid de overeenkomst zonder opgave van redenen te ontbinden gedurende ten minste 14 dagen, ingaande op de dag van het aangaan van de overeenkomst (herroepingsrecht).\r\nDe Gebruiker die gebruik maakt van het herroepingsrecht, dient dit ondubbelzinnig aan de Website kenbaar te maken, bij voorkeur via het contactformulier op de Website dan wel via het Modelformulier voor herroeping, te downloaden via [www.acm.nl/nl/download/publicatie/?id=12754](http://www.acm.nl/nl/download/publicatie/?id=12754). \r\nDe Gebruiker heeft het recht om de aankoop van credits die middels een creditpack aangeschaft zijn binnen 14 dagen zonder opgaaf van redenen te annuleren (het herroepingsrecht). Indien de gebruiker van de aangeschafte credits en de daaraan verbonden diensten binnen deze 14 dagen gebruik maakt, vervalt het herroepingsrecht. Restituties worden binnen 14 dagen nadat de gebruiker kenbaar heeft gemaakt van het herroepingsrecht gebruik te willen maken via de bankoverschrijving betalingswijze terug gestort. De Gebruiker dient in deze gevallen altijd een bankrekening door te geven.\r\nOmdat Gebruiker na totstandkoming van de overeenkomst direct toegang heeft tot en gebruik kan maken van de overeengekomen diensten, is de Gebruiker ingeval van herroeping aan de Website een redelijke vergoeding voor deze diensten verschuldigd van € 1,50 voor iedere dag of dagdeel dat de overeenkomst tot aan het moment van herroeping heeft geduurd, met een maximum van het bedrag dat de Gebruiker op het moment van herroeping reeds aan geld aan de Website heeft betaald. Het dientengevolge verschuldigde bedrag zal door de Website mogen worden verrekend met het door de Gebruiker reeds betaalde gelden; een eventueel na verrekening resterend saldo zal aan de Gebruiker worden teruggestort.\r\n\r\n### Artikel 5: Gebruiksrecht\r\n\r\nWebsite verleent aan de Gebruiker het niet-exclusieve recht van toegang tot de Website om de op de Website geregistreerde gegevens in te zien. Het in het vorige lid bedoelde recht van toegang omvat uitsluitend het recht om de Website te gebruiken overeenkomstig het doel waarvoor de Website is ontwikkeld. De Gebruiker is volledig verantwoordelijk voor het inloggen op de Website en het gebruik van de door Website aan de Gebruiker verstrekte inloggegevens. Escort/Seks tegen betaling is uitgesloten en dus niet mogelijk via deze website. Een van onze doelstellingen is het realiseren van online interactie tussen u en anderen. Gebruiker kan Website geheel anoniem gebruiken. Dit betekent dat Website niet kan vaststellen of iemand daadwerkelijk is wie hij/zij zegt dat hij/zij is enkel op basis van profielgegevens. Voorzichtigheid is dus geboden met het uitwisselen van gegevens. Conform de reglementen van Website is dit om veiligheidsredenen verboden. Website is dan ook op geen enkele wijze verantwoordelijk voor eventuele gevolgen c.q. geleden schade. Het kan zijn dat er profielen aanwezig zijn die niet op echtheid berusten en waarmee geen fysieke ontmoeting kan plaatsvinden.\r\n\r\nDe Gebruiker heeft geen recht de inloggegevens over te dragen. De Gebruiker zal de Website uitsluitend rechtmatig gebruiken en zich in ieder geval onthouden van: het gebruiken of toegang proberen te krijgen tot computersystemen en/of netwerken van anderen dan zichzelf; onderzoek of beproeving van de beveiliging van de Website of netwerken van anderen dan zichzelf; het aantasten van de werking van de Website of netwerken van anderen dan zichzelf; het vervreemden, verhuren of verstrekken aan derden, ten behoeve van derden gebruiken, wijzigen, verwijderen of onbruikbaar maken van de door het in artikel 4.1 bedoelde recht toegankelijke gegevens van anderen dan zichzelf; het ontwerpen, vervaardigen, introduceren en verspreiden van computervirussen en andere computerprogrammatuur die mogelijk schade aan de Website zou kunnen veroorzaken; het schenden van intellectuele eigendomsrechten en/of andere rechten van andere gebruikers. Gedragingen van derden die gebruik maken van de aan die Gebruiker verstrekte Inloggegevens worden aan de Gebruiker toegerekend als ware die gedragingen van de Gebruiker zelf. Website heeft het recht om het gebruik door de Gebruiker van de inloggegevens zonder voorafgaande ingebrekestelling tijdelijk of blijvend te deactiveren, indien de Gebruiker enige verplichting jegens Website niet nakomt.\r\n\r\n### Artikel 6: Inloggegevens\r\n\r\nDe inloggegevens van de Gebruiker zijn persoonsgebonden en strikt geheim. Website en de Gebruiker nemen redelijke maatregelen om te voorkomen dat anderen dan de Gebruiker kennis kunnen nemen van de aan de Gebruiker verstrekte inloggegevens.\r\nIndien Website constateert en/of redelijkerwijs vermoedt dat anderen dan de Gebruiker gebruik (kunnen) maken van de inloggegevens of indien de Gebruiker Website van een zodanig gebruik op de hoogte stelt, blokkeert Website met onmiddellijke ingang de toegang via de bewuste inloggegevens tot de Website. Website stelt de Gebruiker, voor zover nodig, op de hoogte van het onbevoegde gebruik en de blokkering van de inloggegevens en verstrekt zo spoedig mogelijk na de blokkering een vervangende inloggegevens aan de Gebruiker.\r\nIndien het onbevoegde gebruik van een inloggegevens niet aan Website kan worden toegerekend, dient de Gebruiker aan Website de aan de blokkering en vervanging verbonden administratieve kosten aan Website te vergoeden, alsmede de kosten van het onbevoegde gebruik.\r\n\r\n### Artikel 7: Plaatsing van materiaal\r\n\r\nDe Gebruiker plaatst materiaal op de Website op eigen risico.\r\nDe Gebruiker onthoudt zich van het plaatsen van profielnamen, teksten en foto\'s op de Website die aanstootgevend, racistisch of wettelijk verboden zijn.\r\nDe Gebruiker onthoudt zich van het plaatsen van materiaal op de Website waardoor overige Gebruikers contact met de Gebruiker kunnen opnemen zonder gebruik te maken van de specifiek door Website op de Website aangeboden contactmethodes. De Gebruiker plaatst op de Website bijvoorbeeld niet zijn woonadres, telefoonnummer, e-mailadres of links naar internetadressen waar dergelijke gegevens te achterhalen zijn. Ook indirecte verwijzingen of uitlokkingen tot het verstrekken van deze gegevens door andere Gebruikers zijn niet toegestaan. De Gebruiker onthoudt zich eveneens van het op de Website plaatsen van in het vorige lid bedoelde gegevens met betrekking tot andere Gebruikers.\r\nWebsite zal het in de vorige leden bedoelde materiaal verwijderen zonder voorafgaand overleg met en melding aan de Gebruiker of andere Gebruikers. Bij overtreding van bovenstaande regels zal hiertegen worden opgetreden.\r\nWebsite kan materiaal wat niet overeenkomt met de richtlijnen voor Website zonder voorafgaand overleg met en zonder melding aan de Gebruiker of andere Gebruikers verwijderen.\r\n\r\n### Artikel 8: Aanbiedingen per e-mail\r\n\r\nDe Gebruiker die zich bij inschrijving of elders op Website door het plaatsen van een vinkje expliciet akkoord heeft verklaard met het ontvangen van nieuws en Website-aanbiedingen, geeft hierdoor toestemming voor het versturen van nieuwsbrieven en commerciële boodschappen aan het e-mailadres van de Gebruiker. Doorgaans zijn dit unieke acties zoals kortingsacties. De Gebruiker kan zich hiervoor te allen tijde uitschrijven via de uitschrijflink onderaan een dergelijke boodschap. De wijze waarop persoonsgegevens en het e-mailadres worden verwerkt, staat beschreven in het Privacy- en cookiebeleid.\r\n\r\n### Artikel 9: Misbruik\r\n\r\nWebsite kan de overeenkomst met de Gebruiker bij diens misbruik met onmiddellijke ingang beëindigen, materiaal ontoegankelijk maken en/of verwijderen van de Website, het gebruik door de Gebruiker van op de Website aangeboden diensten beperken en/of de toegang tot de Website blokkeren zonder voorafgaande mededeling aan of overleg met de Gebruiker.\r\nBij opzegging van de overeenkomst wegens misbruik heeft de Gebruiker geen recht op restitutie van het reeds door hem betaalde gelden.\r\nWebsite is gerechtigd zonder nadere waarschuwing of ingebrekestelling, en zonder dat daartoe rechterlijke tussenkomst is vereist, een direct opeisbare boete van € 1.000,- (duizend euro) per feit van misbruik aan de Gebruiker in rekening te brengen, waarbij het misbruik van (persoons)gegevens, rekeninggegevens, foto\'s of een ander materiaal en ieder verzonden bericht elk geldt als één afzonderlijk feit, onverminderd het recht van Website om nadere rechtsmaatregelen tegen de Gebruiker te nemen en schadevergoeding te eisen, ook voor het herstel van door de Gebruiker veroorzaakte misbruik.\r\n\r\n### Artikel 10: Gegevens\r\n\r\nDe wijze waarop de privacy wordt gewaarborgd, staat beschreven in het [Privacy- en cookiebeleid](https://altijdsex.nl/privacy).\r\nDe Gebruiker zal Website vrijwaren van alle vorderingen van derden op basis van de stelling dat door Website verwerkte gegevens, het verwerken van gegevens en/of het resultaat van die verwerking in strijd zijn met het geldende recht.\r\n\r\n### Artikel 11: Aansprakelijkheid\r\n\r\nWebsite is nimmer aansprakelijk voor de mogelijke (gevolg)schade van de Gebruiker of van derden.\r\nDe Gebruiker vrijwaart Website terzake alle aanspraken van derden tot vergoeding van (gevolg)schade, die verband houden met deze overeenkomst.\r\nIndien en voor zover een Nederlandse gerechtelijke instantie niettemin oordeelt dat Website aansprakelijk is voor de (gevolg)schade van een Gebruiker of een derde en gehouden is om de schade geheel of gedeeltelijk te vergoeden, wordt de hoogte van de schadevergoeding beperkt tot het door de Gebruiker betaalde abonnementsgeld.\r\n\r\n### Artikel 12: Toepasselijk recht en bevoegde rechter\r\n\r\nOp deze overeenkomst is Nederlands recht van toepassing.\r\nIn geval van een geschil tussen Website en de Gebruiker is de rechtbank te Utrecht bevoegd tot kennisneming van het geschil of, ter keuze van Website, de rechtbank die anders bevoegd zou zijn van het geschil kennis te nemen.\r\n\r\n### Artikel 13: Wijzigingen voorwaarden\r\n\r\nWebsite heeft het recht de voorwaarden te wijzigen en de gewijzigde voorwaarden op bestaande overeenkomsten van toepassing te verklaren, waartoe wijzigingen dertig dagen na bekendmaking aan Gebruiker, in werking treden.\r\n','nl','2020-01-24 17:18:34','2020-02-05 16:05:56'),(2,'Deze Algemene Voorwaarden zijn van kracht met ingang van 1 januari 2020.\r\n\r\n### Artikel 1: Definities\r\n\r\n**Altijdsex.nl**: de Vennootschap Onder Firma met beperkte aansprakelijkheid Devely V.O.F. (KvK-nummer: 77128036) handelend onder de naam Altijdsex.nl;  \r\n**Gebruiker**: de persoon die gebruik maakt van Altijdsex.nl bij deze overeenkomst;  \r\n**Website**: Altijdsex.nl  \r\n**Materiaal**: door de Gebruiker aangeleverd materiaal voor plaatsing op de Website, zoals profielnamen, teksten, foto\'s en (chat)berichten;  \r\n**Misbruik**: het plaatsen van materiaal op de Website of het versturen van berichten via de Website waarmee de rechten of privacy van anderen worden geschonden, het versturen van ongevraagde commerciële informatie en spam, het versturen van commerciële SMS-nummers, het aanbieden van financiële diensten, het doen van grievende of beledigende uitlatingen, het zich voordoen als iemand anders, het gebruiken van andermans rekeninggegevens, inbreuk maken op intellectuele eigendomsrechten of het openbaar maken of verveelvoudigen van materiaal zonder toestemming;  \r\nStandaard toegang: het gebruik van Website waarbij de Gebruiker toegang tot de Website krijgt en beperkt van de op de Website aangeboden diensten gebruik kan maken;  \r\n**VIP-toegang**: het gebruik van Website waarbij de Gebruiker toegang tot de Website krijgt en van de op de Website aangeboden diensten die onder VIP-toegang vallen gebruik kan maken;  \r\n**Toegangsvorm**: geeft aan van welke aangeboden diensten de Gebruiker gebruik kan maken op de Website. Dit is bijvoorbeeld Standaard toegang of VIP-toegang;  \r\n**Credits**: waarmee Gebruiker berichten kan versturen en kan communiceren met andere leden op de website. Wanneer de credits op zijn dienen deze te worden aangevuld om weer berichten te kunnen versturen;  \r\n**Inloggegevens**: de door Gebruiker ingevoerde gegevens waarmee de Gebruiker toegang krijgt tot de Website.  \r\n\r\n### Artikel 2: Overeenkomst\r\n\r\nDeze algemene voorwaarden maken integraal onderdeel uit van iedere tussen Website en de Gebruiker gesloten overeenkomst en zijn van toepassing op iedere overeenkomst.\r\nVan deze algemene voorwaarden afwijkende bedingen zijn slechts rechtsgeldig voor zover zij door Website schriftelijk zijn aanvaard.\r\nDe overeenkomst komt tot stand doordat de Gebruiker het op de Website vermelde inschrijfformulier via de Website aan Website toezendt en dit formulier door Website is ontvangen.\r\nDe overeenkomst is persoonlijk en niet overdraagbaar.\r\nDeelname is alleen mogelijk voor personen van 18 jaar en ouder.\r\n\r\n### Artikel 3: Prijs en betaling\r\n\r\nDe op de Website vermelde bedragen zijn inclusief 21% omzetbelasting (BTW).\r\nDe overeenkomst terzake Standaard toegang eindigt met onmiddellijke ingang door opzegging door Website of de Gebruiker.\r\nDe overeenkomst terzake Credits wordt aangegaan voor onbepaalde duur. \r\nDeze overeenkomst komt tot stand na ontvangst van de betaling van Gebruiker door Website.\r\nAan deze overeenkomst zijn voor Gebruiker geen verplichtingen gebonden. Wanneer de Credits op zijn, heeft Gebruiker geen enkele verplichting ten opzichte van de website om Credits weer aan te vullen. \r\nDe betaalwijze is afhankelijk van de gekozen betaalmethode en is naar keuze van Gebruiker. In alle gevallen betreft het een éénmalige betaling, welke discreet wordt weergegeven op bankafschrift van Gebruiker. \r\nWebsite kan de tarieven van Credits of het aan het Toegangsvorm verbonden recht van toegang tot de Website eenzijdig aanpassen, uitbreiden of intrekken.\r\n\r\n### Artikel 4: Herroepingsrecht\r\n\r\nDe Gebruiker heeft de mogelijkheid de overeenkomst zonder opgave van redenen te ontbinden gedurende ten minste 14 dagen, ingaande op de dag van het aangaan van de overeenkomst (herroepingsrecht).\r\nDe Gebruiker die gebruik maakt van het herroepingsrecht, dient dit ondubbelzinnig aan de Website kenbaar te maken, bij voorkeur via het contactformulier op de Website dan wel via het Modelformulier voor herroeping, te downloaden via [www.acm.nl/nl/download/publicatie/?id=12754](http://www.acm.nl/nl/download/publicatie/?id=12754). \r\nDe Gebruiker heeft het recht om de aankoop van credits die middels een creditpack aangeschaft zijn binnen 14 dagen zonder opgaaf van redenen te annuleren (het herroepingsrecht). Indien de gebruiker van de aangeschafte credits en de daaraan verbonden diensten binnen deze 14 dagen gebruik maakt, vervalt het herroepingsrecht. Restituties worden binnen 14 dagen nadat de gebruiker kenbaar heeft gemaakt van het herroepingsrecht gebruik te willen maken via de bankoverschrijving betalingswijze terug gestort. De Gebruiker dient in deze gevallen altijd een bankrekening door te geven.\r\nOmdat Gebruiker na totstandkoming van de overeenkomst direct toegang heeft tot en gebruik kan maken van de overeengekomen diensten, is de Gebruiker ingeval van herroeping aan de Website een redelijke vergoeding voor deze diensten verschuldigd van € 1,50 voor iedere dag of dagdeel dat de overeenkomst tot aan het moment van herroeping heeft geduurd, met een maximum van het bedrag dat de Gebruiker op het moment van herroeping reeds aan geld aan de Website heeft betaald. Het dientengevolge verschuldigde bedrag zal door de Website mogen worden verrekend met het door de Gebruiker reeds betaalde gelden; een eventueel na verrekening resterend saldo zal aan de Gebruiker worden teruggestort.\r\n\r\n### Artikel 5: Gebruiksrecht\r\n\r\nWebsite verleent aan de Gebruiker het niet-exclusieve recht van toegang tot de Website om de op de Website geregistreerde gegevens in te zien.\r\nHet in het vorige lid bedoelde recht van toegang omvat uitsluitend het recht om de Website te gebruiken overeenkomstig het doel waarvoor de Website is ontwikkeld.\r\nDe Gebruiker is volledig verantwoordelijk voor het inloggen op de Website en het gebruik van de door Website aan de Gebruiker verstrekte inloggegevens.\r\nEen van onze doelstellingen is het realiseren van online interactie tussen u en anderen.\r\nGebruiker kan Website geheel anoniem gebruiken. Dit betekent dat Website niet kan vaststellen of iemand daadwerkelijk is wie hij/zij zegt dat hij/zij is enkel op basis van profielgegevens. Voorzichtigheid is dus geboden met het uitwisselen van gegevens. Conform de reglementen van Website is dit om veiligheidsredenen verboden. Website is dan ook op geen enkele wijze verantwoordelijk voor eventuele gevolgen c.q. geleden schade.\r\nHet kan zijn dat er profielen aanwezig zijn die niet op echtheid berusten en waarmee geen fysieke ontmoeting kan plaatsvinden.\r\nDe Gebruiker heeft geen recht op aflevering of andere verstrekking van de inloggegevens en evenmin om het in lid 1 van dit artikel bedoelde recht over te dragen.\r\nDe Gebruiker zal de Website uitsluitend rechtmatig gebruiken en zich in ieder geval onthouden van:\r\nhet gebruiken of toegang proberen te krijgen tot computersystemen en/of netwerken van anderen dan zichzelf;\r\nonderzoek of beproeving van de beveiliging van de Website of netwerken van anderen dan zichzelf;\r\nhet aantasten van de werking van de Website of netwerken van anderen dan zichzelf;\r\nhet vervreemden, verhuren of verstrekken aan derden, ten behoeve van derden gebruiken, wijzigen, verwijderen of onbruikbaar maken van de door het in artikel 4.1 bedoelde recht toegankelijke gegevens van anderen dan zichzelf;\r\nhet ontwerpen, vervaardigen, introduceren en verspreiden van computervirussen en andere computerprogrammatuur die mogelijk schade aan de Website zou kunnen veroorzaken;\r\nhet schenden van intellectuele eigendomsrechten en/of andere rechten van andere gebruikers. Gedragingen van derden die gebruik maken van de aan die Gebruiker verstrekte Inloggegevens worden aan de Gebruiker toegerekend als ware die gedragingen van de Gebruiker zelf.\r\nWebsite heeft het recht om het gebruik door de Gebruiker van de inloggegevens zonder voorafgaande ingebrekestelling tijdelijk of blijvend te deactiveren, indien de Gebruiker enige verplichting jegens Website niet nakomt.\r\n\r\n### Artikel 6: Inloggegevens\r\n\r\nDe inloggegevens van de Gebruiker zijn persoonsgebonden en strikt geheim. Website en de Gebruiker nemen redelijke maatregelen om te voorkomen dat anderen dan de Gebruiker kennis kunnen nemen van de aan de Gebruiker verstrekte inloggegevens.\r\nIndien Website constateert en/of redelijkerwijs vermoedt dat anderen dan de Gebruiker gebruik (kunnen) maken van de inloggegevens of indien de Gebruiker Website van een zodanig gebruik op de hoogte stelt, blokkeert Website met onmiddellijke ingang de toegang via de bewuste inloggegevens tot de Website. Website stelt de Gebruiker, voor zover nodig, op de hoogte van het onbevoegde gebruik en de blokkering van de inloggegevens en verstrekt zo spoedig mogelijk na de blokkering een vervangende inloggegevens aan de Gebruiker.\r\nIndien het onbevoegde gebruik van een inloggegevens niet aan Website kan worden toegerekend, dient de Gebruiker aan Website de aan de blokkering en vervanging verbonden administratieve kosten aan Website te vergoeden, alsmede de kosten van het onbevoegde gebruik.\r\n\r\n### Artikel 7: Plaatsing van materiaal\r\n\r\nDe Gebruiker plaatst materiaal op de Website op eigen risico.\r\nDe Gebruiker onthoudt zich van het plaatsen van profielnamen, teksten en foto\'s op de Website die aanstootgevend, racistisch of wettelijk verboden zijn.\r\nDe Gebruiker onthoudt zich van het plaatsen van materiaal op de Website waardoor overige Gebruikers contact met de Gebruiker kunnen opnemen zonder gebruik te maken van de specifiek door Website op de Website aangeboden contactmethodes. De Gebruiker plaatst op de Website bijvoorbeeld niet zijn woonadres, telefoonnummer, e-mailadres of links naar internetadressen waar dergelijke gegevens te achterhalen zijn. Ook indirecte verwijzingen of uitlokkingen tot het verstrekken van deze gegevens door andere Gebruikers zijn niet toegestaan. De Gebruiker onthoudt zich eveneens van het op de Website plaatsen van in het vorige lid bedoelde gegevens met betrekking tot andere Gebruikers.\r\nWebsite zal het in de vorige leden bedoelde materiaal verwijderen zonder voorafgaand overleg met en melding aan de Gebruiker of andere Gebruikers. Bij overtreding van bovenstaande regels zal hiertegen worden opgetreden.\r\nWebsite kan materiaal wat niet overeenkomt met de richtlijnen voor Website zonder voorafgaand overleg met en zonder melding aan de Gebruiker of andere Gebruikers verwijderen.\r\n\r\n### Artikel 8: Aanbiedingen per e-mail\r\n\r\nDe Gebruiker die zich bij inschrijving of elders op Website door het plaatsen van een vinkje expliciet akkoord heeft verklaard met het ontvangen van nieuws en Website-aanbiedingen, geeft hierdoor toestemming voor het versturen van nieuwsbrieven en commerciële boodschappen aan het e-mailadres van de Gebruiker. Doorgaans zijn dit unieke acties zoals kortingsacties. De Gebruiker kan zich hiervoor te allen tijde uitschrijven via de uitschrijflink onderaan een dergelijke boodschap. De wijze waarop persoonsgegevens en het e-mailadres worden verwerkt, staat beschreven in het Privacy- en cookiebeleid.\r\n\r\n### Artikel 9: Misbruik\r\n\r\nWebsite kan de overeenkomst met de Gebruiker bij diens misbruik met onmiddellijke ingang beëindigen, materiaal ontoegankelijk maken en/of verwijderen van de Website, het gebruik door de Gebruiker van op de Website aangeboden diensten beperken en/of de toegang tot de Website blokkeren zonder voorafgaande mededeling aan of overleg met de Gebruiker.\r\nBij opzegging van de overeenkomst wegens misbruik heeft de Gebruiker geen recht op restitutie van het reeds door hem betaalde gelden.\r\nWebsite is gerechtigd zonder nadere waarschuwing of ingebrekestelling, en zonder dat daartoe rechterlijke tussenkomst is vereist, een direct opeisbare boete van € 1.000,- (duizend euro) per feit van misbruik aan de Gebruiker in rekening te brengen, waarbij het misbruik van (persoons)gegevens, rekeninggegevens, foto\'s of een ander materiaal en ieder verzonden bericht elk geldt als één afzonderlijk feit, onverminderd het recht van Website om nadere rechtsmaatregelen tegen de Gebruiker te nemen en schadevergoeding te eisen, ook voor het herstel van door de Gebruiker veroorzaakte misbruik.\r\n\r\n### Artikel 10: Gegevens\r\n\r\nDe wijze waarop de privacy wordt gewaarborgd, staat beschreven in het [Privacy- en cookiebeleid](https://altijdsex.nl/privacy).\r\nDe Gebruiker zal Website vrijwaren van alle vorderingen van derden op basis van de stelling dat door Website verwerkte gegevens, het verwerken van gegevens en/of het resultaat van die verwerking in strijd zijn met het geldende recht.\r\n\r\n### Artikel 11: Aansprakelijkheid\r\n\r\nWebsite is nimmer aansprakelijk voor de mogelijke (gevolg)schade van de Gebruiker of van derden.\r\nDe Gebruiker vrijwaart Website terzake alle aanspraken van derden tot vergoeding van (gevolg)schade, die verband houden met deze overeenkomst.\r\nIndien en voor zover een Nederlandse gerechtelijke instantie niettemin oordeelt dat Website aansprakelijk is voor de (gevolg)schade van een Gebruiker of een derde en gehouden is om de schade geheel of gedeeltelijk te vergoeden, wordt de hoogte van de schadevergoeding beperkt tot het door de Gebruiker betaalde abonnementsgeld.\r\n\r\n### Artikel 12: Toepasselijk recht en bevoegde rechter\r\n\r\nOp deze overeenkomst is Nederlands recht van toepassing.\r\nIn geval van een geschil tussen Website en de Gebruiker is de rechtbank te Utrecht bevoegd tot kennisneming van het geschil of, ter keuze van Website, de rechtbank die anders bevoegd zou zijn van het geschil kennis te nemen.\r\n\r\n### Artikel 13: Wijzigingen voorwaarden\r\n\r\nWebsite heeft het recht de voorwaarden te wijzigen en de gewijzigde voorwaarden op bestaande overeenkomsten van toepassing te verklaren, waartoe wijzigingen dertig dagen na bekendmaking aan Gebruiker, in werking treden.\r\n','en','2020-01-24 17:18:34','2020-01-27 17:55:59');
