INSERT INTO `user_meta` VALUES (1,1,NULL,'1992-06-19',1,2,1,'Amsterdam',52.367984300000000,4.903561399999944,1,2,1,1,1,1,'nl','2017-07-09 16:36:56','2019-10-21 15:20:34'),(3,3,'Ik werk in de Entertainment en toerisme (leisure) branche en geniet hier met volle teugen van.. Over 2 jaar ga ik voor docente studeren en is mijn doel om in de toerisme branche les te gaan geven. Met stages ben ik al zo goed als over heel de wereld geweest, maar over een paar jaar wil ik aan de andere kant staan dus en andere mensen opleiden in de toerisme wereld. Het is zo anders vergeleken met andere beroepen. Zoveel vrijheid en blijheid, alleen wel regelmatig van huis, waardoor ik dus helaas nog alleen ben.. Heb trouwens gewoon mijn eigen stekkie in Amsterdam-Noord.','1993-10-06',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,4,1,2,5,2,2,'nl','2017-07-13 10:06:53','2017-07-13 10:12:36'),(4,4,'Een leuke, levendige, spontane en vooral geile jongedame.. Studeren doe ik al niet meer, na mijn HBO diploma kon ik terecht bij een bedrijf waar ik mijn afstudeerstage bij heb gedaan. Mag mezelf officieel Fysiotherapeute noemen. Heb ook nog wel wat lekkere massagekneepjes van het vak geleerd, mag ik je die eens laten ervaren? ','1997-06-10',2,1,2,'Amsterdam',52.367984300000000,4.903561399999944,5,1,3,4,2,1,'nl','2017-07-13 10:28:43','2017-07-13 10:28:43'),(5,5,'Had nooit gedacht dat ik me op zo\'n site zou inschrijven, maar ja je bent jong en je wilt wat hè haha. Er staan nog wat dingen op mijn verlanglijstje, waaronder een heerlijke date met een vrouw en een geile avond met een (wat) oudere man. Wacht even, ik wil niets missen hoor, dus denk je dat je wat voor mij bent en je bent geen mooie dame of oudere man, tja, nooit geschoten altijd mis! Natuurlijk ben ik niet vies van mannen van mijn leeftijd. Volgens mij gaat het allemaal om de magische klik hebben samen, dan komt de rest vanzelf goed toch? ','1993-03-18',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,5,2,3,6,3,1,'nl','2017-08-23 09:33:42','2017-08-23 09:33:42'),(6,6,'Ja ook ik als model ben op zoek naar een boyfriend, heb me net ingeschreven en ik hoop hier wel een beetje succes te hebben. Je bent knap en dat jij nog geen vriendje hebt dat versta ik niet, dat is wat ik te horen krijg van mijn familie en vrienden. Helemaal niet leuk, ben ik wel te kieskeurig dan? Nee ik vind gewoon dat het moet klikken en dat er wederzijds respect is, wat vind jij daar van? Hopelijk word het met jou wel wat ;) Ik heb er zin om mijn zoektocht te starten','1992-06-19',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,4,1,2,4,3,3,'nl','2017-08-23 13:55:24','2017-08-23 13:56:40'),(8,8,'Ben het met mezelf spelen wel een beetje zat aan het raken, kan zulke rare geile gedachtes hebben over normale situaties dat ik ook wel denk dat ik aan geile rollenspellen toe ben. Als jij daar niet vies van bent of gewoon net zoals ik er eens mee wil experimenteren, laat dan gerust een berichtje achter. Ik sta voor een hoop dingen open dus ik denk dat we er wel uit moeten komen. ','1986-10-08',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,5,1,2,5,1,1,'nl','2017-09-04 09:11:45','2017-09-04 09:11:45'),(9,9,'Ik ben altijd al een beetje van het ouderwetse geweest, van huis uit meegekregen.. Seks na het trouwen, een langdurige relatie aangaan noem het maar op.. Heb me hier niet aan kunnen houden haha. Aangezien ik hierdoor vroeger voor m\'n gevoel veel gemist heb wil ik dat goed maken door het in te halen. Na wat positieve geluiden in de omgeving ben ik hier beland. Wil jij vooral lekker genieten samen, of heb je spannende uitdagingen voor me? Liefs, Sandra','1992-03-16',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,4,1,2,6,3,2,'nl','2017-09-04 09:24:34','2017-09-04 09:24:34'),(10,10,'Ik wil bewijzen dat een pondje meer bij een vrouw helemaal niet erg hoeft te zijn.. Daarnaast weet ik alles van lekker koken en bourgondisch genieten, maar we zijn hier om elkaar eerst tussen de lakens uit te testen, ook daar weet ik je wel te overtuigen denk ik! Wanneer mag ik je komen overtuigen?','1984-12-23',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,5,4,1,5,2,1,'nl','2017-09-11 09:30:54','2017-09-11 09:36:05'),(11,11,'Een beetje gek, een beetje prettig gestoord. Maar ik ben oh zo lief eerlijk en oprecht.  Ben jij degene waar ik naar zoek?','1991-04-14',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,4,4,2,NULL,3,3,'nl','2017-09-11 09:34:57','2018-06-28 18:42:34'),(12,12,'Heey, ik ben best een gezellige vrouw, ik hou van mensen om mij heen en zo nu en dan ben ik ook graag alleen of samen met een man lekker op de bank. Mijn vriendinnen weten niet dat ik mij hier heb aangemeld, omdat die niet zo’n voorstanders zijn van “online daten”. Ik heb echt geen moeite met online daten en ik denk ook dat dat een beetje de tijd is waar we nu in leven toch, denk jij van niet?? Hoe dan ook lijkt het mij gewoon heel leuk om hier snel een leuke man te leren kennen.\n\nZie jij een lekker sex afspraakje zonder verplichtingen binnenkort wel zitten, laat het me dan weten. Ik denk dat dat de ideale kennismaking is. Hoe zou die avond voor jou beginnen..?','1987-07-31',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,5,2,2,5,1,2,'nl','2017-09-27 09:10:09','2018-08-27 09:25:31'),(13,13,'Jeannette is mijn naam. Heb me altijd anders voor moeten doen. Mensen hadden bepaalde verwachtingen van mij. Maar nu niet meer. Los van die oneerlijke man, los van mijn verplichtingen. Het is nu Jeannette tijd! En wat rijmt er op Jeannette? Heel goed, jouw bed!','1978-11-23',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,4,2,1,1,2,2,'nl','2018-10-09 20:25:03','2018-10-09 20:25:03'),(14,14,'Vaak kom ik van die rijke playboys tegen, maar vaak zijn dat allemaal praatjes. En praatjes vullen geen...\nIk ben de mannen zat die ik ontmoet in de bars van hotels, daar ging ik meestal op stap.\nSerieus maar ook weer niet. Betrouwbaar, eerlijk en verzorgd. Een gezellige man die zijn mannetje staat en het minimaal toch wel drie keer per nacht volhoud. Ben jij dat?','1994-03-02',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,4,1,3,4,3,1,'nl','2018-10-11 22:52:25','2018-10-11 22:52:25'),(15,15,'Ik ben een hardwerkende huisvrouw terwijl mijn man vaak weg is van huis.. Dan hebben we het niet over uren maar over lange dagen! Voor deze eenzame dagen ben ik op zoek naar leuke man die de stilte in mij wilt verdrijven. Ik zal willen beginnen met een leuke date.. Wat denk jij ervan? ','1982-01-19',2,1,2,'Amsterdam',52.367984300000000,4.903561399999944,5,4,2,5,1,2,'nl','2018-11-21 21:56:05','2018-11-21 21:56:05'),(16,16,'Als secretaresse is het af en toe een eenzaam leven zonder een man. Ik heb dan wel een lieve kat als huisdier maar dat geeft geen voldoening. Ik hoop hier een serieuze man te vinden voor een date of misschien wel meer! Stuur me gewoon een berichtje want zelf zal ik dit niet heel snel doen.\n','1998-01-01',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,4,1,1,5,3,2,'nl','2018-11-21 21:59:50','2018-11-21 21:59:50'),(17,17,'Wat je niet veel zal zien of horen is dat een vrouw in de bouw werkt als timmervrouw.. Echter doe ik dit wel en met een hele hoop plezier! Ik ben een dominante vrouw die weet wat ze wilt. Een klein beetje perfectionistisch kan je mij ook wel noemen en dus zoek ik een vent die zijn mannetje staat! Maar waar zou ik die nou kunnen vinden deze tijd? Xx Ab\n','1978-08-24',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,6,3,3,1,3,3,'nl','2018-11-21 22:04:04','2018-11-21 22:41:18'),(18,18,'Heb jij ook zo zin in een lekker potje plezier , spanning en genot? Ben je al een langere tijd op zoek naar de juiste dame ervoor? Dan meld ik mij heel graag aan om goedgekeurd te worden.. Kan jij ontvangen of durf je lekker stout buiten te genieten? Wat weerhoudt je dan nog mij een bericht te sturen? ;) xx\n','1990-11-14',2,1,2,'Amsterdam',52.367984300000000,4.903561399999944,4,3,2,5,2,1,'nl','2018-11-21 22:08:17','2018-11-21 22:08:17'),(19,19,'Ik ben een echt najaars kind en hou van het heerlijke knusse thuis.. Nu zoek ik alleen nog een vrijwilliger die het aandurft in mijn warme huisje met een knusse bank en misschien wel bed? Ligt helemaal aan jou en hoe snel je kan afspreken ik hou namelijk niet van wachten.. xxx\n','1989-04-08',2,2,1,'Amsterdam',52.367984300000000,4.903561399999944,5,1,3,4,2,2,'nl','2018-11-21 22:13:21','2018-11-21 22:13:21'),(20,20,'Ik ben een halfbloedje die graag dingen doet die mijn ouders niet goedkeuren.. Ik weet niet wat het is ik geil er gewoon op wanneer er dingen gebeuren die niet mogen. Nu nog iemand die dit samen met mij wilt doen.. Lekker geil met speeltjes en hele lange heftige seks.. Iemand?\n','1979-06-11',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,5,3,3,1,3,2,'nl','2018-11-21 22:16:51','2018-11-21 22:16:51'),(21,21,'Studente met een eigen studentenwoning ;) Ik hoef geen jonge gasten onder de 30.. Ik vind het namelijk heerlijk om goed aangepakt te worden door een sugardaddy. Je hoeft niet singel te zijn want buiten stoute seks zoek ik nergens anders naar! Durf jij t aan? Dad? ;)\n','1996-12-30',2,1,1,'Amsterdam',52.367984300000000,4.903561399999944,4,1,1,4,3,1,'nl','2018-11-21 22:20:17','2018-11-21 22:20:17'),(22,22,'Ik heb een bepaalde Fetisj waar mijn man niet mee kan omgaan.. We hebben dan ook de afspraak gemaakt dat ik wat buitenshuis mag zoeken om die tintelingen te stillen. Dus mocht je een man zijn op zoek naar spannende seks op een spannende plaats? Waar wacht je dan nog op? Psst vraag er 1 en krijg er  … ;)\n','1988-02-14',2,1,2,'Amsterdam',52.367984300000000,4.903561399999944,5,3,3,4,2,1,'nl','2018-11-21 22:26:25','2018-11-21 22:26:25'),(23,23,'Stille wateren hebben .. Maak de zin maar af en wie weet krijgen we nog een leuk gesprek samen? Ik heb een hoop te vertellen en ben zeker weten geen saai date maatje.. Dus wat dacht je ervan? Een leuke date samen met een leuke happy ending?\n','1986-03-21',2,2,1,'Venlo',51.370374800000000,6.172403099999997,3,1,4,4,1,3,'nl','2018-11-21 22:31:14','2018-11-21 22:31:14'),(24,24,'Kan jij mij laten zien wat echte liefde is en hoe echte liefde voelt? Hoe de seks voelt wanneer er liefde bij is en hoe een man echt kan zijn wanneer die van je houdt? Ik weet het namelijk niet meer en mijn vertrouwen is weg. xxx\n','1985-04-12',2,1,1,'Venlo',51.370374800000000,6.172403099999997,4,2,4,4,3,2,'nl','2018-11-21 22:34:41','2018-11-21 22:34:41'),(25,25,'Mijn naam is Aevy , dit spreek je ook wel uit als ´Ivy´. Ik kom uit een wat rijkere familie en werk zelf ook heel hard als advocate! Ik zoek dan ook een man met klasse een man die weet wat die doet en die door de keuring van mijn ouders heen komt hihi! Xxx\n','1991-09-01',2,2,1,'Venlo',51.370374800000000,6.172403099999997,4,1,3,4,3,3,'nl','2018-11-21 22:37:16','2018-11-21 22:40:04'),(26,26,'Het is wat vreemd ik heb altijd gezegd dat ik dit noooit zou doen.. En hier ben ik dan met een mond vol tanden en een klein beetje schaamte. Zou jij die schaamte bij mij weg kunnen halen? Wacht dan vooral niet want ik vind het allemaal nog een beetje spannend hihi.\nAileen:\n','1992-10-19',2,1,1,'Venlo',51.370374800000000,6.172403099999997,4,4,2,5,2,2,'nl','2018-11-21 22:43:56','2018-11-21 22:43:56'),(28,28,'Ik ben een mysterieus type die hier en daar raar uit de hoek kan komen. Voor sommige zal dit alleen maar leuk en spannend zijn en voor de anderen zal ik te dominant zijn. Ik ben dan ook op zoek naar de onderdanige mannen die open staan voor een spannend potje seks en rollenspellen.. Bij mij thuis! Interesse? Xx Barbara\n','1971-08-06',2,2,1,'Venlo',51.370374800000000,6.172403099999997,5,4,4,4,1,2,'nl','2018-11-21 22:59:19','2018-11-21 22:59:19'),(29,29,'Ik werk als danser en stripper voor een bureau die mensen uitzend voor op verjaardagen. Echter haal ik hier niet mijn pleziertjes en genot uit en zou ik een fuckbuddy willen vinden voor een aantal keer in de week.. Ik ben dominant en geniet van een beetje pijn x\n','1988-09-11',2,1,2,'Venlo',51.370374800000000,6.172403099999997,5,1,4,6,2,1,'nl','2018-11-21 23:02:10','2018-11-21 23:02:10'),(31,31,'Sommige kijken raar op wanneer ik vertel dat ik daadwerkelijk een huisje boompje beestje mens ben.. Er zullen er niet veel zijn maar daarom zoek ik hier naar de eerlijke man met een aantal wensen xx\n','1998-01-01',2,1,1,'Rotterdam',51.928824000000000,4.478083000000000,4,1,1,6,3,2,'nl','2018-11-21 23:06:34','2018-11-21 23:06:34'),(32,32,'Waar zijn de tijden dat er nog echte mannen zijn die de touwtjes in handen heeft en houdt? Dat is iets wat ik namelijk heel erg mis in deze tijd waardoor ik nog steeds singel ben. Als jij een vent ben neem dan vooral contact op en dan zal ik jouw onderdanige vrouwtje zijn X\n','1970-03-08',2,1,1,'Rotterdam',51.928824000000000,4.478083000000000,5,5,1,5,3,1,'nl','2018-11-21 23:10:56','2018-11-21 23:10:56'),(33,33,'Ik werk als steward voor een groot bedrijf met een aantal verschillende toestellen.. De ene keer ben ik maanden thuis naast jou op de bank.. De andere keer ben je weken alleen maar af en toe 1 a 2 avonden samen. Het is een levensstyle wat je moet aandurven maar je krijgt er veel voor terug inclusief eventuele vrijheid! Xx\n','1990-08-01',2,2,1,'Rotterdam',51.928824000000000,4.478083000000000,5,4,3,4,1,2,'nl','2018-11-22 13:00:51','2018-11-22 13:00:51'),(34,34,'In mijn lange bonte jas zie je mij buiten lopen.. Je hebt met een dame afgesproken voor een spannend hotel dagje. Hoe die eruit gaat zien? Dat mag jij helemaal zelf invullen.. Ik zal alles voor je doen en je dag onvergeetbaar maken. Het enige wat jij nu hoeft te doen is mij te vertellen wat ik onder die jas aan zal trekken en een hotelkamer boeken.. X Corina\n\n','1989-11-15',2,1,2,'Rotterdam',51.928824000000000,4.478083000000000,4,4,4,1,2,1,'nl','2018-11-22 13:03:49','2018-11-22 13:03:49'),(35,35,'Ik ben een echte rockfan al zal je dit niet heel snel zeggen.. Ik werk op festivals achter de knoppen als podiumtechnicus en maak geweldige dingen mee. Wist je dat ik je mag 